// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

//Get funds from users
//Withdraw funds
//Set minimum funding value in usd

import {AggregatorV3Interface} from "@chainlink/contracts@1.3.0/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

contract FundMe {

    uint256 public minimumUsd = 5 * 1e18;
    AggregatorV3Interface private dataFeed;
    address[] public funders; // people that sent money
    mapping(address funder => uint256 amountFunded) public addresToAmountFunded; //how much they sent
    
    function fund() public payable { //allows you to send guap
        //allow users to send money
        //have a minimum usd sent
        require(getConversionRate(msg.value) >= minimumUsd, "not enough"); // revert
        funders.push(msg.sender); //the funder
        addresToAmountFunded[msg.sender] = addresToAmountFunded[msg.sender] + msg.value; //what they previously funded + what they are adding
    }

    function getPrice() public view returns (uint256) {
        //Address (if whichever wallet is tracking the prices)
        //0x694AA1769357215DE4FAC081bf1f309aDC325306
        //ABI 

        (
            /* uint80 roundId */,
            int256 answer,
            /*uint256 startedAt*/,
            /*uint256 updatedAt*/,
            /*uint80 answeredInRound*/
        ) = dataFeed.latestRoundData();
        return uint256(answer) * 1e10;
        // usd to eth 1,575
    }

    function getConversionRate(uint256 ethAmount) public view returns(uint256) {
        uint256 ethPrice = getPrice();
        uint256 ethAmountInUsd = (ethPrice * ethAmount) / 1e18; //always multiply before you divide in solidity
        return ethAmountInUsd;
    }

    function withdraw() public {

    }
}

